import React from 'react'
import {Row, Form} from "antd";
import TextFieldComp from "../Components/TextFieldComp";

const layout = {
    labelCol: {
        span: 8,
    },
    wrapperCol: {
        span: 16,
    },
};

class FormDev extends React.Component {
    render() {
        return (
            <div>
                <main>
                    <Row>
                        <Form
                            name = "FormDev"
                            >
                            <TextFieldComp
                                label = "Name of Child: "
                                placeholder = "Enter name of child"
                                name = "nameOfChild"
                            />
                          
                        </Form>
                    </Row>
                </main>
            </div>
        );
    }
}



export default FormDev;
